import { Container, Card, CardHeader, Nav, NavItem, NavLink, CardBody, TabContent, TabPane } from "reactstrap";

const Education = props => {
  return (
    <div>
      <img alt="..." className="path" src={require("assets/img/path1.png")} />
      <Container>
        <h2 className="title">Education</h2>
        <Card style={{textAlign: 'center', paddingTop: 10, paddingBottom: 10}}>
          <CardHeader>
            Aug 2015 - May 2019
          </CardHeader>
          <CardBody>
            <Container>
              <img
                alt="..."
                style={{width: 65, height: 50, marginTop: 20, marginBottom: 20}}
                src={require("assets/img/msu_logo.png")}
              />
              <h3 style={{marginBottom: 10}}>McNeese State University</h3>
              <h4>Bachelor's of Computer Science</h4>
              <h5>Minor in Mathematics</h5>
              {/* <b>Overall GPA: 3.52, Major GPA: 3.81</b> */}
              <p>Coursework in programming languages, database management, algorithm design,
    computer architecture, operating systems, and artificial intelligence.</p>
            </Container>
          </CardBody>
        </Card>
      </Container>
    </div>
  )
}

export default Education;
